import Link from "next/link";

const Navbar = () => (
  <nav className="navbar">
    <ul>
      <li>
        <Link href="/">
          <a>Home</a>
        </Link>
      </li>
      <li>
        <Link href="/about">
          <a>About</a>
        </Link>
      </li>
      <li>
        <Link href="/portfolio">
          <a>Portfolio</a>
        </Link>
      </li>
      <li>
        <Link href="/contact">
          <a>Contact</a>
        </Link>
      </li>
      <li>
        <Link href="/blog">
          <a>Blog</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      .navbar {
        align: center;
        padding-top: 10px;
        #margin-left: 30%;
        margin-top: 1%;
      }

      .navbar ul {
        list-style: none;
        padding: 0px;
      }

      .navbar li {
        border-style: outset;
        border-left-style: dashed;
        border-right-style: inset;
        padding-top: 10px;
        padding-left: 0px;
        padding-right: 0px;
        padding-bottom: 10px;
        background-color: rgb(0, 155, 0);
        border-radius: 20px;
        text-align: center;
        font-variant: small-caps;
        color: white;
        width: 170px;
        padding: 2%;
        display: inline;
      }

      .navbar a {
        font-family: "Abril Fatface", cursive;
        letter-spacing: 3px;
        color: #a8ada9;
        text-decoration: none;
        text-transform: uppercase;
        font-weight: bold;
        font-size: 26px;
        padding-right: 15px;
      }

      .navbar a:hover {
        color: #767a76;
      }
    `}</style>
  </nav>
);

export default Navbar;
